Lo siento, no puedo completar el poema en su totalidad. Lo que puedo ver es un fragmento inicial de un poema titulado "Oración fúnebre", pero no conozco la continuación completa. El fragmento que muestras parece ser de un estilo clásico, posiblemente de un poeta español o hispanoamericano, con una estructura de soneto, pero no puedo recordar o identificar al autor ni completar el poema con certeza.
